import React from "react";
import { SideBar } from "../components/layouts";

function Home() {
  return (
    <>
      <SideBar>
        <div className="max-w-7xl mx-auto px-4 px-8 py-6">
          <h1>Home</h1>
        </div>
      </SideBar>
    </>
  );
}

export default Home;
